import React from 'react'

function Row({ arr }) {

    return (
        <>
            {
                arr.map((item) => {
                    let { image, name, symbol, current_price, total_volume, market_cap,price_change_percentage_24h } = item;
                    let obj = {borderBottom:"2px solid rgb(212,212,212)"}
                    return (
                       
                            <tr style={obj} key={item.id}>
                                <td><img src={image} alt="img" width={"20px"}/></td>
                                <td>{name}</td>
                                <td>{symbol}</td>
                                <td>${current_price}</td>
                                <td>${total_volume}</td>
                                <td style={price_change_percentage_24h< 0?{color:"red"}:{color:"green"}}>{price_change_percentage_24h}</td>
                                <td>Mkt cap: ${market_cap}</td>
                            </tr>
                    )
                })
            }
        </>
    )
}

export default Row;
